        <div  className="row mb-3">
                  <div  className="col-md-6 mb-3">
                    <div  className="input-group">
                      <label  className="input-group-text" >Academic Qualification </label>
                      <input type = "checkbox" id = "PG" value = "M.B.A / M.Sc / MCA / M.Com"></input>
